import React, { useState } from 'react';
import { getUserProfile } from '../lib/auth'

const profile = () => {

    const [state, setState] = useState({
        user: null
    });

    getUserProfile().then(user => setState({ user }));
    

    return (
        <pre>
            {JSON.stringify(user, null, 2 )}
        </pre>
    )
}

export default profile
